Star Trek Fan Collective - Q (DVDR)


Star Trek: Fan Collective - Q is a DVD collection released by Paramount Pictures. This four disc set contains every episode
from Star Trek: The Next Generation, Star Trek: Deep Space Nine, and Star Trek: Voyager in which there were dealings with the
omnipotent Q. This collection includes a total of 14 television-hours of Star Trek, including 10 standard-length episodes and
2 feature-length movies. It is the only Fan Collective to contain both the series-premiere and series-finale of a series
&quot;Encounter at Farpoint&quot; and &quot;All Good Things...&quot;)



 Episodes
1
  TNG: &quot;Encounter at Farpoint&quot; (feature length)
  TNG: &quot;Hide and Q&quot;
  TNG: &quot;Q Who&quot;

2
  TNG: &quot;Deja Q&quot;
  TNG: &quot;Qpid&quot;
  TNG: &quot;True Q&quot;
  DS9: &quot;Q-Less&quot;

3
  TNG: &quot;Tapestry&quot;
  TNG: &quot;All Good Things...&quot; (feature length)
  VOY: &quot;Death Wish&quot;

4
  VOY: &quot;The Q and the Grey&quot;
  VOY: &quot;Q2&quot;

Special Features:
  * Disc 2 contains text commentaries for &quot;Deja Q&quot; and &quot;Q-Less&quot; by Michael and Denise Okuda.
  * Disc 3 contains text commentary for &quot;Death Wish&quot; by Michael and Denise Okuda.
  * Some copies contain a special mail offer for a Jean-Luc Picard action figure as he is seen towards the end of TNG: &quot;Tapestry&quot; as a Lieutenant J.G. in the Sciences Division.



